import { Fragment } from "react";
import Closets from "../../Components/Closets";
import styles from "./styles.module.scss";
import Button from "../../Components/Button";
import { Link } from "react-router-dom";
import { useState, useEffect } from 'react';
import axios from "axios";
import NavBar from "../../Components/Navbar";
import {useLocation, useNavigate} from "react-router-dom";
import { ClickAwayListener } from "@mui/material";
import logo from "../../images/DWEAR_Logo.png";
import { Checkroom, AccountCircle, Person, Settings, Logout, ArrowDropUp, ArrowDropDown, Check } from "@mui/icons-material"; // Removed unused imports


const closets = [
    {_id: 1, img: "", desc: "Default Closet 1"},
    {_id: 2, img: "", desc: "Default Closet 2"},
];

const Home = () => {
    const [userData, setUserData] = useState(null);
    const [loading, setLoading] = useState(true);
    const location = useLocation();
    const [menu, setMenu] = useState(false);

    const handleLogout = () => {
        navigate('/');
    };

    useEffect(() => {
        if (location.state && location.state.userData) {
            setUserData([location.state.userData]);
            setLoading(false);
        }
    }, [location.state]);
    if (loading) {
        return <p>Loading...</p>
    }

    return(
        <Fragment>
            <div className={styles.container}>
            <div className={styles.left}>
                {/*<div className={styles.icon} onClick={() => navigate(-1)}> 
                    <ArrowBackIosRounded />
                </div>
                <div className={styles.icon} onClick={() => navigate(+1)}>
                    <ArrowForwardIosRounded />
                </div>*/}
                <div className={styles.logo}>
                    <Link to="/">
                        <img src={logo} alt="logo"/>
                    </Link>
                </div>
            </div>
            <div className={styles.right}>
                <div className={styles.profile_menu} onClick={() => setMenu(!menu)}>
                    <AccountCircle />
                    <p>{ userData.name}</p>
                    {menu ? <ArrowDropUp /> : <ArrowDropDown />}
                </div>
            </div>
            {menu && (
                    <ClickAwayListener onClickAway = {() => setMenu(false)}>
                        <div className={styles.menu} onClick={() => setMenu(false)}>
                            <Link to="/home">
                                <div className={styles.options}>
                                    <p>Closets</p>
                                    <Checkroom />
                                </div>
                            </Link>
                            <Link to="/profile">
                                <div className={styles.options}>
                                    <p>Update Profile</p>
                                    <Person />
                                </div>
                            </Link>
                            <Link to="/">
                                <div className={styles.options} onClick={handleLogout}>
                                    <p>Logout</p>
                                    <Logout />
                                </div>
                            </Link>
                        </div>
                    </ClickAwayListener>
                )
            }
        </div>

            <div className={styles.container}>
                <div className={styles.top}>
                    <h1>Your Closets</h1>
                    <Link to="/create_closet">
                        <Button label="Create New Closet" style={{ width: "20rem", marginRight: "5rem"}} />
                    </Link>

                </div>

                <div className={styles.closets_container}>
                    <Closets closets={closets} />
                </div>
            </div>
        </Fragment>
    );
};

export default Home;
